import subprocess
import os
import shutil
import logging
import threading
import time
import tkinter as tk
from tkinter import messagebox
from datetime import datetime, timedelta
from config import load_config, save_config
from utils import decode_base64_to_file, log_message

monitoring_states = {}
monitoring_threads = {}

def run_backup(source, destination, sub_dirs, tree, profile):
    exe_base64 = ''  # Your encoded 7z.exe string
    dll_base64 = ''  # Your encoded 7z.dll string

    if not os.path.exists(destination):
        os.makedirs(destination)

    if not sub_dirs:
        sub_dirs = ['']

    for sub_dir in sub_dirs:
        full_sub_dir = os.path.join(source, sub_dir)
        sub_dir_name = os.path.basename(full_sub_dir)
        dest_sub_dir = os.path.join(destination, sub_dir_name)
        if not os.path.exists(dest_sub_dir):
            os.makedirs(dest_sub_dir)

        temp_dir = os.path.join(dest_sub_dir, f"temp_backup_{profile}")
        if not os.path.exists(temp_dir):
            os.makedirs(temp_dir)

        exe_path = os.path.join(dest_sub_dir, '7z.exe')
        dll_path = os.path.join(dest_sub_dir, '7z.dll')
        decode_base64_to_file(exe_base64, exe_path)
        decode_base64_to_file(dll_base64, dll_path)

        log_message(tree, "Starting backup", f"{sub_dir}")

        for root, dirs, files in os.walk(full_sub_dir):
            for file in files:
                source_file = os.path.join(root, file)
                relative_path = os.path.relpath(source_file, full_sub_dir)
                dest_file = os.path.join(temp_dir, relative_path)
                dest_file_dir = os.path.dirname(dest_file)
                if not os.path.exists(dest_file_dir):
                    os.makedirs(dest_file_dir)
                try:
                    shutil.copy2(source_file, dest_file)
                except Exception as e:
                    log_message(tree, f"Error: Failed to copy {source_file}: {e}")
                    continue

        timestamp = datetime.now().strftime("%B-%d-%Y, %H.%M.%S")
        zip_file = os.path.join(dest_sub_dir, f"{timestamp}.zip")
        
        command = f'"{exe_path}" a "{zip_file}" "{temp_dir}\\*"'
        try:
            result = subprocess.run(command, check=True, shell=True, stdout=subprocess.PIPE, stderr=subprocess.PIPE)
        except subprocess.CalledProcessError as e:
            log_message(tree, f"Error: Compression failed: {e.stderr.decode('utf-8')}")
            return

        shutil.rmtree(temp_dir)
        os.remove(exe_path)
        os.remove(dll_path)
        log_message(tree, "Backup Completed!", f"{source}/{sub_dir}")

def start_monitoring(profile, tree, update_button_states, start_button, stop_button, toggle_input_widgets):
    if monitoring_states.get(profile, False):
        log_message(tree, f"Monitoring already active for {profile}")
        return

    config = load_config(profile)
    config['monitoring_state'] = True
    save_config(config, profile)

    toggle_input_widgets(tk.DISABLED)

    monitoring_states[profile] = True
    
    thread = threading.Thread(target=monitor_directories, args=(profile, tree), daemon=True)
    monitoring_threads[profile] = thread
    thread.start()
    
    update_button_states(profile, start_button, stop_button)

def stop_monitoring(profile, tree, update_button_states, start_button, stop_button, toggle_input_widgets):
    config = load_config(profile)
    config['monitoring_state'] = False
    save_config(config, profile)

    monitoring_states[profile] = False
    log_message(tree, f"Stopped Monitoring Directories for: {profile}")

    toggle_input_widgets(tk.NORMAL)

    update_button_states(profile, start_button, stop_button)

def monitor_directories(profile, tree):
    log_message(tree, f"Started Monitoring Directories for: {profile}")
    
    while monitoring_states.get(profile, False):
        config = load_config(profile)

        dest_dir = config.get('dest_dir', '')
        source_dir = config.get('source_dir', '')
        sub_dirs = config.get('sub_dirs', [])
        zip_files_kept = int(config.get('zip_files_kept', 3))
        interval_days = int(config.get('interval_days', 0))
        interval_hours = int(config.get('interval_hours', 0))
        interval_minutes = int(config.get('interval_minutes', 0))
        interval_seconds = int(config.get('interval_seconds', 0))
        interval = timedelta(days=interval_days, hours=interval_hours, minutes=interval_minutes, seconds=interval_seconds)

        backup_frequency = config.get('backup_frequency', 'Daily')
        backup_time_str = config.get('backup_time', '')
        backup_day_of_week = config.get('backup_day_of_week', '')
        backup_day_of_month = config.get('backup_day_of_month', '')

        if backup_time_str:
            backup_time = datetime.strptime(backup_time_str, "%H:%M").time()
            current_time = datetime.now().time()
            current_day_of_week = datetime.now().strftime("%A")
            current_day_of_month = datetime.now().day

            if backup_frequency == 'Daily':
                if current_time >= backup_time and current_time < (datetime.combine(datetime.today(), backup_time) + interval).time():
                    if monitoring_states.get(profile, False):
                        if source_dir and dest_dir:
                            run_backup(source_dir, dest_dir, sub_dirs, tree, profile)
                        else:
                            log_message(tree, f"Error: Source or destination directory is empty for {profile}")

            elif backup_frequency == 'Weekly':
                if current_day_of_week == backup_day_of_week and current_time >= backup_time and current_time < (datetime.combine(datetime.today(), backup_time) + interval).time():
                    if monitoring_states.get(profile, False):
                        if source_dir and dest_dir:
                            run_backup(source_dir, dest_dir, sub_dirs, tree, profile)
                        else:
                            log_message(tree, f"Error: Source or destination directory is empty for {profile}")

            elif backup_frequency == 'Monthly':
                if isinstance(backup_day_of_month, str):
                    backup_day_of_month = int(backup_day_of_month.split('/')[0])
                
                if current_day_of_month == backup_day_of_month and current_time >= backup_time and current_time < (datetime.combine(datetime.today(), backup_time) + interval).time():
                    if monitoring_states.get(profile, False):
                        if source_dir and dest_dir:
                            run_backup(source_dir, dest_dir, sub_dirs, tree, profile)
                        else:
                            log_message(tree, f"Error: Source or destination directory is empty for {profile}")

        for sub_dir in sub_dirs:
            full_sub_dir = os.path.join(dest_dir, sub_dir)
            if os.path.exists(full_sub_dir):
                zip_files = [os.path.join(full_sub_dir, f) for f in os.listdir(full_sub_dir) if f.endswith('.zip')]
                zip_files.sort(key=os.path.getctime, reverse=True)
                for old_file in zip_files[zip_files_kept:]:
                    try:
                        os.remove(old_file)
                        log_message(tree, "Deleted old backup:", old_file)
                    except Exception as e:
                        log_message(tree, f"Error: Failed to delete: {e}", old_file)

        time.sleep(interval.total_seconds())

def start_backup_for_profile(profile, source, destination, sub_dirs, tree):
    threading.Thread(target=run_backup, args=(source, destination, sub_dirs, tree, profile)).start()
